{"query":"query {
  repository(owner: "chingu-voyagetest", name: "voyage-template") {
    id
    name
    object(expression: "HEAD:") {
      # Top-level.
      ... on Tree {
        entries {
          name
          type
          object {
            ... on Blob {
              byteSize
            }
            # One level down.
            ... on Tree {
              entries {
                name
                type
                object {
                  ... on Blob {
                    byteSize
                  }
                }
              }
            }
          }
        }
      }
    }
  }
}"}

{"query":"query {
  repository (owner: "chingu-voyagetest", name: "v99-toucans-team-01") {
    name
    labels(first: 20) { 
      nodes {
        name
        color
      }
    }
  }
}"}

{"query":"query {
  repository(owner: "chingu-voyagetest", name: "voyage-template") {
      id
      name
      description
      owner {
        id
      }

      issueTemplates {
        name
        title
        about
        body  
      }
      issues (first: 15) {
        totalCount
        edges {
          node {
            title
            body
            milestone {
              id
              title
              description
            }
            labels (first: 10) {
              edges {
                node {
                  name
                  color
                }
              }
            }
          }
        }
      }
      labels(first:15) {
        edges {
          node {
            id
            name
            color
            description 
          }
        }
      }
      milestones(first:10) {
        edges {
          node {
            title
            description
          }
        }
      }
    }
} "}

